import React from 'react';
import ReactDOM from 'react-dom';

import $ from "jquery"
import Effluentchart from './Effluentchart';
//import Effluentchart from './components/Effluentchart';

class Effluent extends React.Component {
  constructor(props) {
    super(props);    
    this.state = {
      context: props.context
    };
    this.onBtnClick = this.onBtnClick.bind(this);
  }
  
  onBtnClick() {
    this.state.context.getBgColor(this, function(color, self) {
      self.state.context.setBgColor('green');
    });
  }
  render() {
    return (
      <>
    <div className='alert alert-success' role='alert'>
        <h3>Hi there!</h3>
        <button type='button' className='btn btn-default' onClick={ this.onBtnClick }>Click to Update!</button>
      </div>
 
</>
    );
  }
}
